webpackJsonp([39138080330483],{8782:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Ullrich vs. Armstrong",date:"26 Jul 2003",slug:"/2003-07-26-ullrich-vs-armstrong/",tags:"Y2003"},html:'<p><a title="15:59 CET: Do it :: hebig.org/blog" href="http://www.hebig.org/blogs/archives/main/001091.php">Ullrich</a>  vs. <a title="Eamonn Fitzgerald\'s Rainy Day: On yer bike, Lance, ye boyo!" href="http://www.eamonn.com/archives/000553.html#000553">Armstrong</a></p>'},next:{fields:{title:"Stone Cold",date:"26 Jul 2003",slug:"/2003-07-26-stone-cold/"}},previous:{fields:{title:"World New York: Technical Self-Employment",date:"26 Jul 2003",slug:"/2003-07-26-world-new-york-technical-self-employment/"}}},{node:{fields:{title:"Stone Cold",date:"26 Jul 2003",slug:"/2003-07-26-stone-cold/",tags:"Y2003"},html:'<p>Listening to our local <a title="Radio Hamburg" href="http://www.radiohh.de/">corporate 40</a> station this evening, something caught my ear that I had to listen more closely. Was the north German teeny band <a href="http://www.echt.de/">Echt</a> now singing in English? No, the band <a href="http://www.deuceproject.com/">Deuce Project</a> has covered the bittersweet \'don\'t you wish your ex would come crawling back to you so you could turn your back on her\' song <a href="http://www.letssingit.com/echt-du-tragst-keine-liebe-in-dir-qgb8jwl.html">\'Keine Liebe\'</a>, which they translated as <a href="http://www.deuceproject.com/the-deuce-project-lyrics.html#stone-cold">\'Stone Cold\'</a>. Interesting that an American band would cover a German song, and a fairly intelligent song at that. Typical that the cover band gets the <a href="http://www.deuceproject.com/images/deucebillboardsinglereview.jpg">credit</a> for the text and the catchy melody.</p>\n<p><i>Denn Du trägst keine Liebe in Dir,<br />\nnicht für mich und für irgendwen.<br />\nDu trägst keine Liebe in Dir,<br />\nDir nachzutrauern hat keinen Sinn mehr.<br />\nDenn Du trägst keine Liebe in Dir.<br />\nDich zu vergessen, war nicht sehr schwer.<br />\nDenn Du trägst keine Liebe in Dir.</i></p>'},next:{fields:{title:"Israpundit: 22 Truths",date:"25 Jul 2003",slug:"/2003-07-25-israpundit-22-truths/"}},previous:{fields:{title:"Ullrich vs. Armstrong",date:"26 Jul 2003",slug:"/2003-07-26-ullrich-vs-armstrong/"}}},{node:{fields:{title:"Israpundit: 22 Truths",date:"25 Jul 2003",slug:"/2003-07-25-israpundit-22-truths/",tags:"Y2003"},html:'<p><a title="If even only half of them are true..." href="http://israpundit.com/archives/001803.html">Israpundit: 22 Truths</a></p>'},next:{fields:{title:"I wish Des Moines were more like Minneapolis",date:"25 Jul 2003",slug:"/2003-07-25-i-wish-des-moines-were-more-like-minneapolis/"}},previous:{fields:{title:"Stone Cold",date:"26 Jul 2003",slug:"/2003-07-26-stone-cold/"}}}],pathPrefix:"",first:!1,last:!1,index:668,pageCount:1101}}}});
